function CustomForm({type, placeholder, onChange}) {
  return (
    <form className="">
      <div></div>
        <label className='flex flex-row drop-shadow-xl rounded-full'>
          <input
                type={type}
                placeholder={placeholder}
                className='text-center rounded-xl h-[40px] w-[100%] text-base font-inter'
                onChange={onChange}
                />  
          <button>HAPUS</button>
        </label>
    </form>
  );
}

export default CustomForm;
